  }
  
  //
  
  
  if (gk.indexOf('M')+1) {
    h = 1;
    switch (gd['M']) {
      case 3: h |= 0; break;
      case 109: h |= 1 << 1; break;
      case 2: h |= 2 << 1; break; // final
      default: return; // not implemented
    }
    s = gd['S'];
    h |= 1 << 3;
    write(h, 1);
    write(s, 1);
    //zprintf(PSTR("M%d S%d\n"), fi(gd['M), fi(s));
  }
  if (gk.indexOf('G')+1) {
    h = 0;
    switch (gd['G']) {
      case 0: h |= 0; break;
      case 1: h |= 1 << 1; break;
      case 28:
        h |= 2 << 1;
        cntg28--;
        break;
      case 92: h |= 3 << 1; break;
      default: return; // not implemented
    }
    if (gk.indexOf('F')+1)h |= 1 << 3;
    if (gk.indexOf('X')+1)h |= 1 << 4;
    if (gk.indexOf('Y')+1)h |= 1 << 5;
    if (gk.indexOf('Z')+1)h |= 1 << 6;
    if (gk.indexOf('E')+1)h |= 1 << 7;

    write(h, 1);
    if (gk.indexOf('F')+1) {
      f = Math.min(gd['F']*0.0167, 250);
      write(f, 1);
    }
	var dx=0;
	var dy=0;
    if (gk.indexOf('X')+1) {
      x = gd['X'] * 100;
	  if (isRel)x+=lx;
	  dx=x-lx;
      lx=x;
      write(x+16000, 2);
	  //log(x);
    }
    if (gk.indexOf('Y')+1) {
      x = gd['Y'] * 100;
	  if (isRel)x+=ly;
      dy=x-ly;
	  ly=x;
      write(x+16000, 2);
    }
    if (gk.indexOf('Z')+1) {
      x = gd['Z'] * 100;
	  if (isRel)x+=lz;
      lz=x;
      write(x+5000, 2);
    }
	var is_e=0;
    if (gk.indexOf('E')+1) {
      x = gd['E'] * 1000;
	  if (isRel)x+=le;
	  is_e=1;//(x>=le);
      le=x;
      write(x, 3);
    }
	// save the vertex
	if ((gd['G']<=1)){
		// 3d XYZ to 2D transform
		var tx=lx+ly*0.3;
		var ty=-lz-ly*0.3;
		// save bounding box
		xmax=Math.max(xmax,tx);		
		xmin=Math.min(xmin,tx);		
		ymax=Math.max(ymax,ty);		
		ymin=Math.min(ymin,ty);		
		zmax=Math.max(zmax,ly);		
		zmin=Math.min(zmin,ly);
		// save vertex
		vertex.push([tx,ty,-ly]);
		
		if (is_e){
			// cheap fast lighting
			l=Math.abs(125*dx/Math.sqrt(dx*dx+dy*dy));
			// if there is extruder value then save the line
			lines.push([vertex.length-2,vertex.length-1,l]);
		}
	}
  }
  if (!cntg28) {
    endcompress();
    cntg28 = 2;
  }
}

function getColor(v) {
	var v=Math.floor(v);
    var letters = '0123456789ABCDEF';
    var color = letters[(v>>4)&15]+letters[v&15];
    return "#44"+color+"88";
}

function rendergcode(){
    // nice background
	var grd=ctx.createLinearGradient(0,0,0,200);
	grd.addColorStop(0,"#88bbFF");
	grd.addColorStop(0.35,"white");
	grd.addColorStop(0.55,"#eeaa33");
	grd.addColorStop(1,"#bb7711");

	ctx.fillStyle=grd;
	ctx.fillRect(0,0,200,200);
	//ctx.clearRect(0, 0, 200, 200);

	//calculate scale
	var zs=125.0/(zmax-zmin);
	var xs=200.0/(xmax-xmin);
	var ys=200.0/(ymax-ymin);
	
	var sc = Math.min(xs,ys);
	var xa=-xmin*xs;
	var za=-zmin*zs;
	var ya=-ymin*ys;
	// draw backlines
	var front=[];
	for (var i=1;i<lines.length-1;i++){
		var v1=vertex[lines[i][0]];
		var v2=vertex[lines[i][1]];
		// light color
		ll=getColor(lines[i][2]+v1[2]*zs+za);
		// transform to canvas size
		var x1=v1[0]*sc+xa;
		var x2=v2[0]*sc+xa;
		var y1=v1[1]*sc+ya;
		var y2=v2[1]*sc+ya;
		if (x1>x2)
		{
			ctx.beginPath();
			ctx.strokeStyle=ll;
			ctx.moveTo(x1, y1);
			ctx.lineTo(x2, y2);
			ctx.stroke();
		} else { 
			// save front
			front.push([x1, y1,x2, y2,ll]);
		}
	}
	// draw frontlines
	for (var i=0;i<front.length-1;i++){
		f=front[i];
		ctx.beginPath();
		ctx.strokeStyle=f[4];
		ctx.moveTo(f[0], f[1]);
		ctx.lineTo(f[2], f[3]);
		ctx.stroke();
	}
}


function begincompress(){
	xmax=-100000;
	xmin=100000;
	ymax=-100000;
	ymin=100000;
	zmax=-100000;
	zmin=100000;
	
	vertex=[]; // will hold x,y,z
	lines=[]; // will hold n1,n2 that index point to vertex
	compress=[];
	isRel=0;
	totalgcode=0;
	texts=getvalue("gcode").split("\n");
	cntg28=2;
	for (var i=0;i<texts.length;i++){
		addgcode(texts[i]);
	}
	  h = 1;
	  h |= 2 << 1;
	  write(h, 1);
	
	setvalue("gcomp",compress.toString());
	$("info").innerHTML="Original "+totalgcode+"bytes > "+compress.length+" bytes, ratio "+mround(totalgcode/compress.length);
	rendergcode();
}
function urlopen(s){
  var xhr = new XMLHttpRequest();
  xhr.open( "GET","/"+s,true);
  xhr.send();
}
function startprint(){
  urlopen("startprint");
}
function stopprint(){
  urlopen("stopprint");
}
function pauseprint(){
  urlopen("pauseprint");
}
function resumeprint(){
  urlopen("resumeprint");
}
function realupload(blobOrFile) {
  var xhr = new XMLHttpRequest();
  form = new FormData();
  form.append("name",blobOrFile,"gcode");
  xhr.open(
            "POST",
            "/upload",
            true
        );
  var progressBar = document.querySelector('progress');
  xhr.onload = function(e) {progressBar.value = 0;};
  // Listen to the upload progress.
  xhr.upload.onprogress = function(e) {
    if (e.lengthComputable) {
      progressBar.value = (e.loaded / e.total) * 100;
      progressBar.textContent = progressBar.value; // Fallback for unsupported browsers.
    }
  };

  xhr.send(form);
}
function upload(){
	realupload(new Blob([new Int8Array(compress).buffer],{type:"text/plain"}));
}
begincompress();
